import Chat from './components/chat';
import Login from './components/login';
import { createBrowserRouter,RouterProvider } from 'react-router-dom';
import './App.css';

function App() {
  const rotas = createBrowserRouter([{
    path: "/",
    children: [
      {
        path: "/",
        element: <Login/>,  
      },
      {
        path: "chat",
        element: <Chat/>
      }
    ]
  }]);
  return (
    <div className="App">
      <RouterProvider router={rotas} >
      </RouterProvider>
    </div>
  );
}

export default App;
